import React from 'react';
import icon from '../../assets/pix-icon.svg';

class PiXIcon extends React.Component<Props> {

  constructor(props: any) {
    super(props);
    this.state = { 
      //state
    };
  }

  public render(){
    return (
      <React.Fragment>
        <header className="PiXIcon">
          <div className="PiXIcon-Component">
            <img className="PiX-Icon" src={icon} alt="icon" onClick={this.toggle}/>
          </div>
        </header>
      </React.Fragment>
    )
  }
}

type MyProps = {
  onClick: () => any;
};

type Props = MyProps;

export default PiXIcon;
